    value: "RE: November Monthly Report (10/1/09-10/31/09)    1.\tDisbursements made
      for FEA exempt mail production, FEA exempt mail, FEA Exempt mail, and FEA EXEMPT
      MAIL meet the definition of exempt activities.  The disbursements were for campaign
      materials and the activity was conducted on behalf of the partys nominees in
      the general election, the materials were distributed by volunteers-not through
      public political advertising, the party committee did not use materials purchased
      by the national party committee or money transferred from the national committee
      to purchase materials, the party committee did not use funds designated for
      a particular federal candidate, a payment from a non-federal campaign to help
      pay for the materials did not exceed its allocated share of the expenses, and
      the costs allocable to federal candidates were paid with permissible funds.
      \  2.\tSchedule B supporting Line 30(b) of the above referenced report discloses
      a payment(s) for FEA exempt mail production, FEA exempt mail, FEA Exempt mail,
      and FEA EXEMPT MAIL.  The federal candidate associated with these disbursements
      is Dede Scozzafava (H0NY23065), PO Box 171, Gouverneur, NY 13642.  Disbursements
      made for FEA exempt mail production, FEA exempt mail, FEA Exempt mail, and FEA
      EXEMPT MAIL meet the definition of exempt activities.    3.\tThe coordinated
      expenditure schedule (Schedule F) on the amended report discloses the identification
      of the designating committee, the payees name and address, the purpose of the
      expenditure, the identification of the candidate supported, the office sought,
      state and district (if applicable), the date and amount of the payment and the
      aggregate general election expenditure total for each candidate supported.    Please
      be advised that expenditures for employees who spend more than 25% of their
      compensated time on Federal Election Activity are detailed on Schedule B for
      Line 30."
